import React from "react";

const StudentSearch = () => {
  return (
    <div className="border-gray-500 h-max w-1/2 ml-2 rounded-lg bg-gray-200">
      <div className=" flex justify-center align-top h-64 max-w-5xl border-black border-0 pt-3">
        <h1>Search Studnet</h1>
      </div>
    </div>
  );
};

export default StudentSearch;
